scale: 5
pwm = true
#hardware_pwm: False
value = 0
shutdown_value = 0
cycle_time = 0.001

[idle_timeout]
timeout: 900

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PC5, EXP1_3=PB1, EXP1_5=PE9,  EXP1_7=PE11, EXP1_9=<GND>,
    EXP1_2=PB0, EXP1_4=PE8, EXP1_6=PE10, EXP1_8=PE12, EXP1_10=<5V>,
    # EXP2 header
    EXP2_1=PA6, EXP2_3=PE7, EXP2_5=PB2, EXP2_7=PC4,   EXP2_9=<GND>,
    EXP2_2=PA5, EXP2_4=PA4, EXP2_6=PA7, EXP2_8=<RST>, EXP2_10=<NC>

[temperature_sensor dell_pc]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

[gcode_arcs]
#resolution: 1.0

[respond]
default_type: echo
default_prefix: S8:

